/**
 * Sort the course sections into object.
 * So that object.lecture is the lectures of the course, object.tutorial is the tutorials, and object.practical is the practicals
 *
 * @param {Course} course
 */
const sortCourseSection = course => {
  const lectures = course.meeting_sections.filter(
    section => section.sectionCode.charAt(0) === 'L',
  );
  const tutorials = course.meeting_sections.filter(
    section => section.sectionCode.charAt(0) === 'T',
  );
  const practicals = course.meeting_sections.filter(
    section => section.sectionCode.charAt(0) === 'P',
  );
  for (const lecture of lectures) {
    lecture.comboCode = course.courseCode + lecture.sectionCode;
  }
  for (const tutorial of tutorials) {
    tutorial.comboCode = course.courseCode + tutorial.sectionCode;
  }
  for (const practical of practicals) {
    practical.comboCode = course.courseCode + practical.sectionCode;
  }
  return {
    code: course.courseCode,
    lecture: lectures,
    tutorial: tutorials,
    practical: practicals,
  };
};
